import React from "react";

function Seasons() {
  return (
    <div class="seasons">
      <div id="spring">
        <img src="Images/spring.png" alt="Seasons-img" />
      </div>
      <div id="summer">
        <img src="Images/summer.png" alt="Seasons-img" />
      </div>
      <div id="autumn">
        <img src="Images/autumn.png" alt="Seasons-img" />
      </div>
      <div id="winter">
        <img src="Images/winter.png" alt="Seasons-img" />
      </div>
    </div>
  );
}

export default Seasons;
